    Button,
    ButtonGroup,
    Card,
    CardHeader,
    CardBody,
    CardTitle,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    UncontrolledDropdown,
    Label,
    FormGroup,
    Input,
    Table,
    Row,
    Col,
    UncontrolledTooltip,
  } from "reactstrap";



  import {
    LineChart_ProductionTime, 
    LineChart_DefectRate,
    LineChart_Defects,
    LineChart_ProductionOutput, 
  } from "variables/charts.js";


const ProductionOutput = ({title, LineChart_ProductionOutput_Example1, }) => {

    if (title == 1){
        return (
            <>



            <Col xs="12">
              <Card className="card-chart">
                <CardHeader>
                  <Row>
                    <Col className="text-left" sm="6">
                      <CardTitle tag="h3">Production Output</CardTitle>
                    </Col>
                    <Col sm="6">

                    </Col>
                  </Row>
                </CardHeader>
                <CardBody>
                  <div className="chart-area">
                    <Line
                      data={LineChart_ProductionOutput[LineChart_ProductionOutput_Example1]}
                      options={LineChart_ProductionOutput.options}
                    />
                  </div>
                </CardBody>

              </Card>
            </Col>





     </>
        )
    }

    else{
    return (
        null


    );}
};

export default ProductionOutput;
